import { useEffect, useState } from 'react';

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [classes, setClasses] = useState([]);
  const [newUser, setNewUser] = useState({ username: '', email: '', password: '', role: 'student' });
  const [newClass, setNewClass] = useState({ name: '', description: '', instructor_id: '', semester: '', start_date: '', end_date: '' });
  const [associations, setAssociations] = useState({ student_id: '', class_id: '', parent1_id: '', parent2_id: '' });
  const [message, setMessage] = useState('');

  useEffect(() => {
    const fetchUsersAndClasses = async () => {
      const usersRes = await fetch('http://localhost:5100/api/users/all');
      const classesRes = await fetch('http://localhost:5100/api/classes/all');
      setUsers(await usersRes.json());
      setClasses(await classesRes.json());
    };

    fetchUsersAndClasses();
  }, []);

  const handleCreateUser = async () => {
    if (!newUser.username || !newUser.email || !newUser.password) {
      setMessage('Please fill in all required fields.');
      return;
    }
    await fetch('http://localhost:5100/api/admin/create-user', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newUser),
    });
    setNewUser({ username: '', email: '', password: '', role: 'student' });
    setMessage('User created successfully!');
  };

  const handleCreateClass = async () => {
    // Similar validation and success message for class creation
  };

  const handleAssignStudentToClass = async () => {
    // Similar validation and success message for assigning student to class
  };

  const handleAssignParent = async () => {
    // Similar validation and success message for assigning parents
  };

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-4xl font-bold mb-8 text-center">Admin Dashboard</h1>
      {message && <div className="mb-4 text-green-600">{message}</div>}

      {/* Create User Section */}
      <section className="mb-8 p-6 border rounded-lg shadow-md bg-white">
        <h2 className="text-2xl font-semibold mb-4">Create User</h2>
        <input className="border p-2 mb-2 w-full" type="text" placeholder="Username" value={newUser.username} onChange={(e) => setNewUser({ ...newUser, username: e.target.value })} />
        <input className="border p-2 mb-2 w-full" type="email" placeholder="Email" value={newUser.email} onChange={(e) => setNewUser({ ...newUser, email: e.target.value })} />
        <input className="border p-2 mb-2 w-full" type="password" placeholder="Password" value={newUser.password} onChange={(e) => setNewUser({ ...newUser, password: e.target.value })} />
        <select className="border p-2 mb-4 w-full" value={newUser.role} onChange={(e) => setNewUser({ ...newUser, role: e.target.value })}>
          <option value="admin">Admin</option>
          <option value="instructor">Instructor</option>
          <option value="student">Student</option>
          <option value="parent">Parent</option>
        </select>
        <button className="bg-blue-600 text-white p-2 rounded hover:bg-blue-700 transition duration-200" onClick={handleCreateUser}>Create User</button>
      </section>

      {/* Assign Student to Class Section */}
      <section className="mb-8 p-6 border rounded-lg shadow-md bg-white">
        <h2 className="text-2xl font-semibold mb-4">Assign Student to Class</h2>
        <button className="bg-green-600 text-white p-2 rounded hover:bg-green-700 transition duration-200" onClick={handleAssignStudentToClass}>Assign</button>
      </section>

      {/* Assign Parents to Student Section */}
      <section className="mb-8 p-6 border rounded-lg shadow-md bg-white">
        <h2 className="text-2xl font-semibold mb-4">Assign Parents</h2>
        <button className="bg-yellow-600 text-white p-2 rounded hover:bg-yellow-700 transition duration-200" onClick={handleAssignParent}>Assign</button>
      </section>
    </div>
  );
};

export default AdminDashboard;
